export enum LayoutBlockTypes {
  HEADER = 'header',
  PROFILE = 'profile',
  BUTTON_LINK = 'button_link',
  SOCIAL_LINKS = 'social_links',
  IMAGE_LINK = 'image_link',
  SUB_HEADING = 'sub_heading',
  TEXT = 'text',
  YOUTUBE = 'youtube',
  SPOTIFY = 'spotify',
}
// type ProfileLayoutAttribs = {
// }
// type TextLayoutAttribs = {
// }
export type LayoutBlock = {
  id: string;
  type: LayoutBlockTypes;
  visible: boolean;
  // TODO: try to create each type for each attrib type
  attributes: any;
  meta: {};
};

type StartPageService = {
  isInLayout: (id: string) => void;
  syncBlock: (block: LayoutBlock) => void;
  moveBlock: (id: string, atIndex: number) => void;
  finalizeMoveBlock: (id: string, atIndex: number) => void;
  findBlock: (id: string) => { block: LayoutBlock; index: number } | void;
};

const StartPageContext = createContext<LayoutBlock[]>([]);
// initialize with empty service for now
const StartPageServiceContext = createContext<StartPageService>({
  isInLayout: () => {},
  syncBlock: () => {},
  moveBlock: () => {},
  finalizeMoveBlock: () => {},
  findBlock: () => {},
});

