const GQL_GET_STARTPAGE = gql`
  query GetStartPage($startpageId: ID!) {
    startpage(id: $startpageId) {
      id
      name
      layout {
        id
        type
        visible
        attributes {
          ... on LayoutBlockAttribProfile {
            logoImage
            logoAltText
            bannerImage
            headerName
            headerDescription
            format
          }
          ... on LayoutBlockAttribButtonLink {
            label
            uri
          }
          ... on LayoutBlockAttribImageLink {
            image
            imageCaption
            altText
            uri
          }
          ... on LayoutBlockAttribText {
            content
          }
          ... on LayoutBlockAttribSubHeading {
            content
          }
          ... on LayoutBlockAttribYoutube {
            uri
          }
          ... on LayoutBlockAttribSpotify {
            uri
          }
        }
      }
    }
  }
`;

const GQL_SYNC_BLOCK = gql`
  mutation SyncLayoutBlock($input: SyncLayoutBlockInput!) {
    syncLayoutBlock(input: $input) {
      id
      type
      visible
      attributes {
        ... on LayoutBlockAttribProfile {
          logoImage
          logoAltText
          bannerImage
          headerName
          headerDescription
          format
        }
        ... on LayoutBlockAttribButtonLink {
          label
          uri
        }
        ... on LayoutBlockAttribImageLink {
          image
          imageCaption
          altText
          uri
        }
        ... on LayoutBlockAttribText {
          content
        }
        ... on LayoutBlockAttribSubHeading {
          content
        }
        ... on LayoutBlockAttribYoutube {
          uri
        }
        ... on LayoutBlockAttribSpotify {
          uri
        }
      }
    }
  }
`;

const GQL_MOVE_BLOCK = gql`
  mutation MoveLayoutBlock($moveLayoutBlockInput: MoveLayoutBlockInput!) {
    moveLayoutBlock(input: $moveLayoutBlockInput)
  }
`;
const START_PAGE_ID = 'c6b07a3c-f54e-44fc-a5b5-03eb5143785f';

export function StartPageProvider({ children }: { children: JSX.Element }) {
  const [startPagelayout, setStartPagelayout] = useState<LayoutBlock[]>([]);

  const { loading, error, data } = useQuery(GQL_GET_STARTPAGE, {
    // TODO: static for now, until accounts module is added
    variables: { startpageId: START_PAGE_ID },
    onCompleted: (data) => {
      initStartPage(_.cloneDeep(data));
    },
    onError: (err) => {
      // we fallback to static setup
      initStartPage(null);
    },
  });
  const [gqlSyncBlock, gqlSyncBlockData] = useMutation(GQL_SYNC_BLOCK);
  const [gqlMoveBlock, gqlMoveBlockData] = useMutation(GQL_MOVE_BLOCK);

  const initStartPage = (initData: any) => {
    if (initData) {
      setStartPagelayout(initData.startpage.layout);
      return;
    }

    const defaultData: LayoutBlock[] = DEFAULT_LAYOUT;
    const storedData = JSON.parse(
      localStorage.getItem('startpage_layout') || '[]'
    );

    setStartPagelayout(storedData.length === 0 ? defaultData : storedData);
    // setStartPagelayout(defaultData);
  };

  useEffect(() => {
    localStorage.setItem('startpage_layout', JSON.stringify(startPagelayout));
  }, [startPagelayout]);

  const isInLayout = (id: string) => {
    return startPagelayout.findIndex((b) => b.id === id) !== -1;
  };

  const serverSyncBLock = (block: LayoutBlock) => {
    // NOTE: temp 'any'a to remove warning of delete
    const blockInput: any = _.cloneDeep(block);
    delete blockInput.meta;

    gqlSyncBlock({
      variables: {
        input: { startPageId: START_PAGE_ID, layoutBlockData: blockInput },
      },
    });
  };

  const syncBlock = (block: LayoutBlock) => {
    const idx = startPagelayout.findIndex((b) => b.id === block.id);

    // add if not in the layout
    if (idx === -1) {
      setStartPagelayout(update(startPagelayout, { $push: [block] }));

      serverSyncBLock(block);
      return;
    }

    // re-assign to index the updated block
    // same as:
    //   startPagelayout[idx] = block;
    //   setStartPagelayout([...startPagelayout]);
    setStartPagelayout(
      update(startPagelayout, {
        $splice: [
          [idx, 1],
          [idx, 0, block],
        ],
      })
    );

    serverSyncBLock(block);
  };

  const moveBlock = (id: string, atIndex: number) => {
    const { block, index } = findBlock(id);

    setStartPagelayout(
      update(startPagelayout, {
        $splice: [
          [index, 1],
          [atIndex, 0, block],
        ],
      })
    );
  };

  const finalizeMoveBlock = (id: string, atIndex: number) => {
    // we need to create a finalize version since moveBlock is being called onhover (repeatedly)
    moveBlock(id, atIndex);

    gqlMoveBlock({
      variables: {
        moveLayoutBlockInput: {
          startPageId: START_PAGE_ID,
          layoutBlockId: id,
          newIdx: atIndex,
        },
      },
    });
  };

  const findBlock = (id: string) => {
    const block = startPagelayout.filter((b) => b.id === id)[0];

    return {
      block,
      index: startPagelayout.indexOf(block),
    };
  };

  // service needs to be inside here so we can use the state
  const StartPageService: StartPageService = {
    isInLayout,
    findBlock,
    syncBlock,
    moveBlock,
    finalizeMoveBlock,
  };

  return (
    <StartPageContext.Provider value={startPagelayout}>
      <StartPageServiceContext.Provider value={StartPageService}>
        {children}
      </StartPageServiceContext.Provider>
    </StartPageContext.Provider>
  );
}

export const useStartPage = (): [LayoutBlock[], StartPageService] => {
  const startPagelayout = useContext(StartPageContext);
  const StartPageService = useContext(StartPageServiceContext);

  return [startPagelayout, StartPageService];
};
